/***********************************************************************
 * n8n Code-Node · JavaScript · run once for EACH item
 *
 * Ziel:
 * ──────────
 *  • internal_note analysieren
 *  • folgende Felder ins Item schreiben
 *      – productKey              (interner eindeutiger Funnel-Key)
 *      – Setting Call Herkunft   (Label für Airtable)
 *      – activeCampaign          (Boolean, ob AC-Tag gesetzt wird)
 *      – activeCampaignTag       (AC-Tag-ID oder null)
 *      – airtableAllSubmissions  (Boolean, ob Eintrag in Tabelle 
 *                                 “All Submissions” angelegt wird)
 *      – urlPath                 (Slug für Airtable “URL Path”)
 *
 *  → Danach routet ein Switch-Router anhand der Booleans in die
 *    Zweige AC / All-Submissions / Fallback.
 **********************************************************************/

/* --------------------------------------------------------------------
 * 1)   internal_note normalisieren
 * ------------------------------------------------------------------ */
const raw  = item.json.resource?.internal_note ?? '';
const note = raw                    // z. B. "type=Setting Call&Funnel=Linktree"
  .normalize('NFC')                 // Unicode vereinheitlichen
  .replace(/\s+/g, ' ')             // Mehrfach-Spaces → 1 Space
  .trim()
  .toLowerCase();                   // alles klein

/* --------------------------------------------------------------------
 * 2)   Vergleichs-Hilfen
 * ------------------------------------------------------------------ */
const equals   = (p) => (txt) => txt === p.toLowerCase().replace(/\s+/g, ' ').trim();
const contains = (p) => {
  const esc = p.replace(/[.*+?^${}()|[\]\\]/g, '\\$&');    // Sonderzeichen escapen
  const rx  = new RegExp(esc.replace(/\\?\s+/g, '\\s*'), 'i');
  return (txt) => rx.test(txt);
};
const regex    = (re) => (txt) => (typeof re === 'string' ? new RegExp(re, 'i') : re).test(txt);
const kebab    = (s) => s.toLowerCase()
                         .normalize('NFKD').replace(/[^\w\s-]/g, '')
                         .trim().replace(/\s+/g, '-');

/* --------------------------------------------------------------------
 * 3)   Mapping-Tabelle
 * ------------------------------------------------------------------
 *   Struktur pro Zeile  (Array index → Bedeutung)
 *   ─────────────────────────────────────────────────────────────────
 *   [0] productKey          Kurz-Bezeichner des Funnels
 *   [1] herkunftLabel       Emoji-Label für Airtable-Feld
 *   [2] compareType         'eq' = equals , 'ct' = contains , 'rx' = RegExp
 *   [3] pattern             String oder RegExp, der im internal_note gesucht wird
 *   [4] activeCampaign?     true|false   → soll AC-Tag gesetzt werden?
 *   [5] activeCampaignTag   Zahl|null    → AC-Tag-ID (nur wenn [4] true)
 *   [6] allSubmissions?     true|false   → Datensatz in Tabelle “All Submissions”?
 *   [7] urlPath (optional)  Slug für Airtable “URL Path”
 *                           Leer → Slug wird automatisch aus productKey erzeugt
 * ------------------------------------------------------------------ */
const MAP = [
  /* ---------- Standard-Funnel & Affiliate ------------------------ */
  ['Outbound',                 '📞 Outbound',             'ct', 'Outbound',                                                true, 222, false, 'outbound'],
  ['Buch Funnel',              '📖 🎁 Buch Geschenk',     'ct', 'Buch Funnel',                                             true,  95, false, 'buch-funnel'],
  ['Content Cash Cow',         '💰 Booster Call',         'ct', 'Content Cash Cow',                                        true, 130, false, 'content-cash-cow'],
  ['Support',                  '❤️ Support',              'ct', 'Support',                                                 true, 129, false, 'support'],
  ['Interview Funnel',         '🎤 Mia Interview',        'ct', 'Interview Funnel',                                        true, 131, false, 'interview-funnel'],
  /* Affiliate-Varianten – spezifische zuerst, dann generisch ------- */
  ['Affiliate - GM',           '💎 Göttinnen Mentoring',  'eq', 'type=Setting Call&Affiliate - Göttinnen Mentoring',        false,null,false,'affiliate-gm'],
  ['Paid Masterclass',         '📀 Paid Masterclass',     'ct', 'type=Setting Call&Paid Masterclass',                       true, 130, false,'paid-masterclass'],
  ['Affiliate - SC Paid MC',   '📀 Paid Masterclass',     'eq', 'type=Setting Call&Affiliate - Social Chronicles Paid Masterclass', true, 130, false,'paid-masterclass'],
  ['Affiliate Mia Interview',  '🎤 Mia Interview',        'eq', 'type=Setting Call&Affiliate - Social Chronicles Interview',false,null,false,'affiliate'],
  ['Affiliate SM Evergreen',   '📱 SM Evergreen',         'eq', 'type=Setting Call&Affiliate - Social Chronicles Evergreen',false,null,false,'affiliate'],

  /* ---------- Social Chronicles ---------------------------------- */
  ['SC Webseite',              '📱 SM Evergreen Webseite','eq', 'type=Setting Call&Social Chronicles - Webseite',          false, null, false,'sm-evergreen-webseite'],
  ['SC Live Webinar',          '🔴 SC LIVE Webinar 08.05.2025',   'eq', 'type=Setting Call&Social Chronicles - Setting LIVE Webinar',true, 222, false,'sm-evergreen-live'],
  ['SC Evergreen Webinar',     '📱 SM Evergreen',         'eq', 'type=Setting Call&Social Chronicles - Evergreen-Webinar', false, null, false,'sm-evergreen'],
  ['SC Personality Flow',      '✨ Personality Flow',     'eq', 'type=Setting Call&Personality E-Mail Flow',               false, null, false,'personality-flow'],

  /* ---------- Göttinnen Mentoring ------------------------------- */
  ['GM VSL',                   '💎 Göttinnen Mentoring',  'eq', 'type=Setting Call&Göttinnen Mentoring - VSL',              false, null, false,'gm-vsl'],
  ['GM Webseite',              '💎 Göttinnen Mentoring Webseite','eq','type=Setting Call&Göttinnen Mentoring - Webseite',   false, null, false,'gm-webseite'],
  ['GM Typeform',              '💎 Göttinnen Mentoring Typeform','eq','type=Setting Call&Göttinnen Mentoring - Typeform',   false, null, false,'gm-typeform'],
  ['GM 1o1 Bewerbung',         '💎 GM 1o1 Bewerbung',     'eq', 'type=Setting Call&Göttinnen Mentoring 1o1 Bewerbung',      false, null, false,'gm-1o1-bewerbung'],
  ['GM Soul of Woman',         '💎 GM Soul of Woman',     'eq', 'type=Setting Call&Göttinnen Mentoring / Soul of Woman',    true, 145, false,'gm-1o1-bewerbung'],

  /* ---------- DOSM / Skool / IG-DM ------------------------------- */
  ['Skool',                    '💬 Skool DOSM',           'eq', 'type=Setting Call&Skool',                                   false,null,false,'skool'],
  ['IG DM DOSM',               '💬 IG DM',                'eq', 'type=Setting Call&DOSM-IG-DM',                              false,null,true ,'ig-dm-dosm'],
  ['IG DM MIA',                '📲 MIA IG DM',            'eq', 'type=Setting Call&MIA-IG-DM',                               false,null,true ,'ig-dm-mia'],
  ['DOSM',                     '📲 DOSM Days',                 'eq', 'type=Setting Call&DOSM',                               true, 145, false,'dosm'],

  /* ---------- Quiz Funnel ---------------------------------------- */
  ['GM Quiz Funnel',           '☯️ Quiz Funnel APHRODITE',   'eq', 'type=Setting Call&GM Quiz Funnel Score APHRODITE',       true, 179, false,'gm-quiz-funnel'],
  ['GM Quiz Funnel',           '☯️ Quiz Funnel HERA',        'eq', 'type=Setting Call&GM Quiz Funnel Score HERA',            true, 180, false,'gm-quiz-funnel'],
  ['GM Quiz Funnel',           '☯️ Quiz Funnel ARTEMIS',     'eq', 'type=Setting Call&GM Quiz Funnel Score ARTEMIS',         true, 181, false,'gm-quiz-funnel'],
  ['GM Quiz Funnel',           '☯️ Quiz Funnel ATHENA',      'eq', 'type=Setting Call&GM Quiz Funnel Score ATHENA',          true, 182, false,'gm-quiz-funnel'],

  /* ---------- Linktree (mit & ohne “Call”) ---------------------- */
  ['Linktree',                 '✳️ Linktree Call',             'ct', 'type=Setting Call&Funnel=Linktree',                    false,null,false,'linktree'],

  /* ---------- Newsletter ---------------------------------------- */
  ['Newsletter Pitch',         '📰 Newsletter Pitch',     'eq', 'type=Setting Call&Newsletter-Pitch',                        false,null,true ,'newsletter-pitch'],
  ['Newsletter Reply',         '📰 Newsletter Reply',     'eq', 'type=Setting Call&Newsletter-Reply',                        false,null,true ,'newsletter-reply'],

  /* ---------- SOW / Founder Summit ------------------------------ */
  ['SOW VSL',                  '💎 SOWC',                 'eq', 'type=Setting Call&SOW VSL',                                 true, 147, false,'sow-vsl'],
  ['Founder Summit',           '🏦 Founder Summit 2025',  'eq', 'type=Setting Call&Founder-Summit',                          true, 150, false,'founder-summit']
];

/* --------------------------------------------------------------------
 * 4)   Erste passende Regel finden
 * ------------------------------------------------------------------ */
let hit = {
  productKey:'Unknown',
  herkunft:'🤷‍♂️ Unbekannt',
  activeCampaign:false,
  activeCampaignTag:null,
  airtableAllSubmissions:false,
  urlPath:'unknown'
};

for (const [k,h,cmp,pat,ac,tag,ats,url] of MAP) {
  const match =
    (cmp==='eq' ? equals(pat) :
     cmp==='ct' ? contains(pat) :
     /* cmp==='rx'*/ regex(pat)
    )(note);

  if (match) {
    hit = {
      productKey:            k,
      herkunft:              h,
      activeCampaign:        ac,
      activeCampaignTag:     tag,
      airtableAllSubmissions:ats,
      urlPath:               url || kebab(k)
    };
    break;
  }
}

/* --------------------------------------------------------------------
 * 5)   Felder ans Item anhängen
 * ------------------------------------------------------------------ */
Object.assign(item.json, {
  productKey:               hit.productKey,
  'Setting Call Herkunft':  hit.herkunft,
  activeCampaign:           hit.activeCampaign,
  activeCampaignTag:        hit.activeCampaignTag,
  airtableAllSubmissions:   hit.airtableAllSubmissions,
  urlPath:                  hit.urlPath
});

return item;
